import { combineReducers } from "redux";
import { persistReducer } from "redux-persist";
import storage from "redux-persist/lib/storage";
import DevicesIDReducer from "./DevicesIDReducer";
import DevicesDataReducer from "./DevicesDataReducer";
import AllBuildingsReducer from "./AllBuildingsReducer";
import BuildingAssetsReducer from "./BuildingAssetsReducer";
import AssetDevicesReducer from "./AssetDevicesReducer";

export default combineReducers({
  DevicesIDReducer: persistReducer(
    { key: "DevicesIDReducer", storage, whitelist: ["data"] },
    DevicesIDReducer
  ),
  DevicesDataReducer: persistReducer(
    { key: "DevicesDataReducer", storage, whitelist: ["state"] },
    DevicesDataReducer
  ),
  AllBuildingsReducer: persistReducer(
    { key: "AllBuildingsReducer", storage, whitelist: ["data"] },
    AllBuildingsReducer
  ),
  BuildingAssetsReducer: persistReducer(
    { key: "BuildingAssetsReducer", storage, whitelist: ["data"] },
    BuildingAssetsReducer
  ),
  // AssetDevicesReducer: persistReducer(
